①：Activate 1 of these effects (but you can only choose each effect of this card's name once per turn);
● If you control a "Hecahands" monster: Target 1 Spell/Trap your opponent controls; return it to the hand.
● Fusion Summon 1 "Hecahands" Fusion Monster from your Extra Deck, by banishing its material from your field and/or GY. If you use face-up monsters you control owned by your opponent, you can treat them as "Hecahands" monsters.
